import './App.css';

function App() {
  return (
    <div className="App">
      <h1>HotelsNOW</h1>
        <div>
          <ul>
            <li><a href="#">Home</a></li>
            <li><a href="#">Our Services</a></li>
            <li><a href="#">About Us</a></li>
            <li><a href="#">Blog</a></li>
            <li><a href="#">Contact us</a></li>
            <li><a href="#" class="book">Book Now</a></li>
          </ul>
        </div>

        <p>Your home away from home</p>
        <p>Where Comfort and Affordability meet</p>
        <li><a href="#" class="book">Explore now</a></li>
    </div>
  );
}

export default App;
